import Numpad from "./Numpad";
import Operation from "./Operation";

function Calculator() {

    const generateNumpad = () => {
        let numpad = [];
        for(let i = 0; i < 9; i++){
            numpad += <Numpad/>
        }

        return numpad;
    }

    return (
        <div>
            <Operation />
            {generateNumpad()}
        </div>
    );
}

export default Calculator;
